import React from 'react';
import logo from './logo.svg';
import './Card.css';

function Card() {
    return (

        <div className="card">
            <div className="title">Título</div>
            <div className="logos">
                <img src="https://static.vecteezy.com/system/resources/previews/007/500/756/non_2x/thermometer-icon-temperature-icon-isolated-on-white-background-free-vector.jpg" alt="Logo 3" />
            </div>
            
        </div>



    );
}

export default Card;
